【世界初！加熱式タバコシステム「iQOS」】タバコは充電する時代へ。<br>
・本物のたばこ葉（別売り「マルボロ ヒートスティック」）を加熱するから、たばこ本来の味と香りを楽しむことができます。<br>
・火を使わない。灰が出ない。ニオイが少ない。空気を汚さない。革新のタバコ加熱システムです。<br>
<br>
【本物のたばこ葉を革新のヒートテクノロジーで加熱】<br>
・たばこ本来の味わいを思う存分楽しみながら、煙やニオイといった周りの人が感じる不快な思いを減らしたい。「iQOS」は、そんな要望を叶える全く新しいたばこの楽しみ方をお届けします。<br>

※こちらはiQOSヒートシステム一式のみです。<br>
※使用には別売りのiQOS専用たばこ「マルボロ ヒートスティック」が必要です。<br>
ｖ<br>
